"use strict";(self.webpackChunk=self.webpackChunk||[]).push([[5013],{5013:function(e){e.exports=JSON.parse('{"en":{"main_title":"Garden of earthly delights","name":"Garden of earthly delights","author":"Hieronymus Bosch","year":"1510","description":"The picture shows one of the options for paradise. In one area, a group of naked figures intertwine, biting a huge juicy strawberry. Others sway enthusiastically from palaces built of shapes resembling muddy reproductive organs, shimmering crystals and seed boxes ready to burst. Fountains of pure blue water flow directly into the mouth; the fruits are plucked; and the duos nurture shiny bubbles."},"ua":{"main_title":"Сад земних насолод","name":"Сад земних насолод","author":"Ієронім Босх","year":"1510","description":"На малюнку зображений один з варіантів раю. На одній ділянці група оголених фігур переплітається, кусаючи величезну соковиту полуницю. Інші з ентузіазмом коливаються від палаців, побудованих із форм, що нагадують брудні репродуктивні органи, мерехтливі кристали та коробочки для насіння, які готові лопнути. Фонтани чистої блакитної води стікають прямо в рот; плоди зриваються; і дуети плекають блискучі бульбашки."},"es":{"main_title":"Jardín de las delicias terrenales","name":"Jardín de las delicias terrenales","author":"Hieronymus Bosch","year":"1510","description":"La imagen muestra una de las opciones para el paraíso. En un área, un grupo de figuras desnudas se entrelazan, mordiendo una enorme y jugosa fresa. Otros se balancean con entusiasmo desde palacios construidos con formas que se asemejan a órganos reproductivos embarrados, cristales brillantes y cajas de semillas. a punto de reventar. Fuentes de agua azul pura fluyen directamente en la boca; los frutos se arrancan; y los dúos nutren burbujas brillantes."},"specifical":{"authorLink":"hieronymus-bosch"}}')}}]);